/*Table structure for table `penentuan_segmentasi` */

DROP TABLE IF EXISTS `penentuan_segmentasi`;

CREATE TABLE `penentuan_segmentasi` (
  `kode_penentuan_segmentasi` int(11) NOT NULL AUTO_INCREMENT,
  `kode_wilayah_pasar` int(11) NOT NULL,
  `kode_kriteria_penilaian_segmentasi` int(11) NOT NULL,
  `nilai_segmentasi` float NOT NULL,
  PRIMARY KEY (`kode_penentuan_segmentasi`),
  KEY `kode_kategori_segmentasi` (`kode_kriteria_penilaian_segmentasi`),
  KEY `kode_wilayah_pasar` (`kode_wilayah_pasar`),
  CONSTRAINT `penentuan_segmentasi_ibfk_3` FOREIGN KEY (`kode_wilayah_pasar`) REFERENCES `wilayah_pasar` (`kode_wilayah_pasar`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `penentuan_segmentasi_ibfk_2` FOREIGN KEY (`kode_kriteria_penilaian_segmentasi`) REFERENCES `kriteria_penilaian_segmentasi` (`kode_kriteria_penilaian_segmentasi`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `penentuan_segmentasi` */

/*Table structure for table `pengguna` */

DROP TABLE IF EXISTS `pengguna`;

CREATE TABLE `pengguna` (
  `id_pengguna` int(11) NOT NULL AUTO_INCREMENT,
  `nik` varchar(16) DEFAULT NULL,
  `username` varchar(128) NOT NULL,
  `email` varchar(128) NOT NULL,
  `photo` varchar(255) NOT NULL,
  `tanggal_update` datetime NOT NULL,
  `status` enum('Aktif','Tidak Aktif') NOT NULL,
  `password` varchar(255) NOT NULL,
  `level` enum('Direktur Utama','Manager','Marketing','Staff Administrasi') NOT NULL,
  PRIMARY KEY (`id_pengguna`),
  KEY `nik` (`nik`),
  CONSTRAINT `pengguna_ibfk_1` FOREIGN KEY (`nik`) REFERENCES `pegawai` (`nik`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;

