/*Table structure for table `promosi` */

DROP TABLE IF EXISTS `promosi`;

CREATE TABLE `promosi` (
  `kode_promosi` int(11) NOT NULL AUTO_INCREMENT,
  `id_pengguna` int(11) NOT NULL,
  `nama_promosi` varchar(128) NOT NULL,
  `isi_promosi` text NOT NULL,
  `gambar` varchar(255) NOT NULL,
  `tanggal_mulai` date NOT NULL,
  `tanggal_selesai` date NOT NULL,
  `status` enum('Aktif','Tidak Aktif') NOT NULL,
  PRIMARY KEY (`kode_promosi`),
  KEY `id_pengguna` (`id_pengguna`),
  CONSTRAINT `promosi_ibfk_1` FOREIGN KEY (`id_pengguna`) REFERENCES `pengguna` (`id_pengguna`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

/*Data for the table `promosi` */

/*Table structure for table `transaksi` */

DROP TABLE IF EXISTS `transaksi`;

CREATE TABLE `transaksi` (
  `kode_transaksi` varchar(16) NOT NULL,
  `kode_pelanggan` int(11) NOT NULL,
  `tanggal` date NOT NULL,
  `status_pengerjaan` enum('Dalam Proses','Selesai','Dibatalkan') NOT NULL,
  `status_pembayaran` enum('Lunas','Belum Lunas') NOT NULL,
  `status_transaksi` enum('Diterima','Dalam Proses','Dibatalkan') NOT NULL,
  PRIMARY KEY (`kode_transaksi`),
  KEY `kode_pelanggan` (`kode_pelanggan`),
  CONSTRAINT `transaksi_ibfk_1` FOREIGN KEY (`kode_pelanggan`) REFERENCES `pelanggan` (`kode_pelanggan`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `transaksi` */

/*Table structure for table `wilayah_pasar` */

DROP TABLE IF EXISTS `wilayah_pasar`;

CREATE TABLE `wilayah_pasar` (
  `kode_wilayah_pasar` int(11) NOT NULL AUTO_INCREMENT,
  `id_pengguna` int(11) NOT NULL,
  `nama_wilayah_pasar` varchar(128) NOT NULL,
  `keterangan` text NOT NULL,
  `status_kandidat` enum('Ya','Tidak','Dalam Proses') NOT NULL,
  `status_pemilihan` enum('Ya','Tidak','Dalam Proses') NOT NULL,
  `status_penilaian` enum('Belum','Sudah') NOT NULL,
  `hasil_penilaian` float NOT NULL,
  `status` enum('Aktif','Tidak Aktif') NOT NULL,
  PRIMARY KEY (`kode_wilayah_pasar`),
  KEY `id_pengguna` (`id_pengguna`),
  CONSTRAINT `wilayah_pasar_ibfk_1` FOREIGN KEY (`id_pengguna`) REFERENCES `pengguna` (`id_pengguna`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=latin1;

